style.css:
@-moz-document domain("www.whatbeatsrock.com") {
body, div, .bottom-0 {
		background: #333;
		color: #fff;
	}

	.gap-x-2 p {
		color: #b2b2b2;
	}
	
	* {
		border-color: #222;
	}

	input, textarea {
		background: #444;
		color: #fff;
	}

	input::placeholder, textarea::placeholder {
		color: #b2b2b2;
	}

	button {
		background: #444;
	}

	button:hover {
		background: #555;
	}
	
	.bg-red-200 {
		background: #af2d2d;
	}
	
	.bg-blue-100, .bg-green-100 {
		background: #333;
	}
	
	.bg-green-300 {
		--tw-bg-opacity: 0;
	}

	.justify-center.gap-x-1 {
		background: #fff0;
	}
	
	.bg-green-200, .bg-green-300 {
		background: #008709
	}

	.bg-green-200:hover, .bg-green-300:hover {
		background: #00c40d;
	}
}
